INSERT INTO `info_strings` VALUES (1,'Info Cash-Betaling','<p>Ga naar het OSD-lokaal tijdens de openingsuren om u betaling uit te voeren. Weet je het lokaal niet zijn? <a title=\"Kijk hier!\" href=\"../../pages/guide\" target=\"_self\">Kijk hier</a>!</p>',5,'2011-09-30 14:46:39','2011-10-01 15:58:11',0),(2,'cash','<p>Je kan u cashbetaling uitvoeren in het OSD-lokaal tijdens de openingsuren. Weet je het lokaal nog niet zijn? <a title=\"Kijk hier!\" href=\"../../pages/guide\" target=\"_blank\">Kijk hier!</a></p>\r\n<p>lol</p>',5,'2011-09-30 14:47:05','2011-10-06 09:22:00',0),(3,'transfer','<p>Wenst u te betalen via overschrijving, plaats dan de order key als mededeling in u overschrijving</p>\r\n<p>Overschrijven kan op volgend rekeningnummer: 363-0944543-94</p>',5,'2011-09-30 14:49:08','2011-10-03 12:57:51',0),(4,'general_payment','<p>U bestelling wordt pas behandeld vanaf het ogenblik dat de betaling is ontvangen.</p>\r\n<p>U wordt per mail op de hoogte gebracht bij ontvangst van de overschrijving. Wanneer uw bestelling klaar ligt in het OSD-lokaal wordt dit opnieuw via mail gestuurd',5,'2011-09-30 14:49:25','2011-10-03 10:45:49',0),(5,'about_CD','<p>Infogroep is SOO <strong>10100111001</strong></p>',9,'2011-10-04 14:34:01','2011-10-10 16:26:10',0),(6,'cash','<p>Je kan u cashbetaling uitvoeren in het OSD-lokaal tijdens de openingsuren. Weet je het lokaal nog niet zijn? <a title=\"Kijk hier!\" href=\"http://esp.cursusdienst.net/pages/guide\" target=\"_blank\">Kijk hier!</a></p>',11,'2011-10-05 13:41:21','2011-10-05 13:41:21',0),(7,'cash','<p>Je kan u cashbetaling uitvoeren in het OSD-lokaal tijdens de openingsuren. Weet je het lokaal nog niet zijn? <a href=\"ppk.cursusdienst.net/pages/guide\" target=\"_self\">Kijk hier</a>!</p>',3,'2011-10-05 13:42:05','2011-10-05 13:47:43',0),(8,'transfer','<p>Wenst u te betalen via overschrijving, plaats dan de order key als mededeling in u overschrijving</p>\r\n<p>Overschrijven kan op volgend rekeningnummer: 363-0944543-94</p>',11,