INSERT INTO `messages` VALUES (1,10,'<p>&nbsp;</p>\r\n<p>Welkom op de pagina van de Overkoepelende StudentenDienst.</p>\r\n<p>In samenwerking met de facultaire kringen van de VUB hebben wij nu een centrale cursusdienst geopend om jullie in de toekomst beter te bedienen.</p>\r\n<p>Weet je ons lokaal nog niet zijn, of wens je onmiddellijk naar het aanbod van u richting te gaan? Neem dan een kijkje <a href=\"http://esp.cursusdienst.net/pages/guide\"><strong>hier</strong></a> of <a href=\"http://cursusdienst.net\"><strong>hier</strong></a>!.</p>\r\n<p>Tot binnenkort,</p>\r\n<p>Het OSD-Team</p>','2011-10-01 10:33:46','2011-10-10 08:31:30',0),(2,5,'<p style=\"text-align: center;\">Welkom !</p>\r\n<p style=\"text-align: left;\">Je moet je cursusmateriaal online bestellen. Betalen kan via overschrijving of cash in de winkel. Eens je bestelling betaald is wordt hij geplaatst bij de drukker. Je krijgt een mail wanneer je bestelling klaarligt in de winkel.</p>\r\n<p style=\"text-align: left;\">Meer info over hoe bestellen&nbsp;<strong><a href=\"../../pages/guide\" target=\"_blank\">hier</a></strong></p>\r\n<p><strong>Waar :</strong></p>\r\n<p>We zijn te vinden in het BSG-lokaal (achter gebouw E).</p>\r\n<p><strong>Openingsuren :&nbsp;</strong></p>\r\n<p>Alle weekdagen van 12u tot 14u&nbsp;</p>\r\n<p>Elke dinsdag en donderdag avond van 17u30 tot 19u30</p>\r\n<p><span class=\"Apple-style-span\" style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 15px;\"><span class=\"Apple-style-span\" style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 15px;\"><br /></span></span></p>','2011-10-01 14:39:07','2011-10-09 20:49:10',0),(3,9,'<p>Voorlopig is ons aanbod nog beschikbaar op <a title=\"cursusdienst.infogroep.be\" href=\"http://cursusdienst.infogroep.be\" target=\"_blank\">cursusdienst.infogroep.be</a></p>\r\n<p>&nbsp;</p>','2011-10-03 19:24:03','2011-10-04 14:32:44',0),(4,3,'<p>Als je als student een PPK lidkaart hebt, dan krijg je per bestelling een euro korting. Als dit zo is, laat dan je PPK lidkaart zien in de OSD-shop. </p>','2011-10-03 19:26:14','2011-10-05 13:44:38',0),(5,5,'<p>De ESP Cursusdienst is open.</p>\r\n<p>Aarzel niet om regelmatig terug te komen en zien of we geen nieuwe samenvattingen, slides of readers uitgeven.</p>','2011-10-03 19:26:56','2011-10-03 19:26:56',0),(6,8,'<p style=\"text-align: center;\">Welkom !</p>\r\n<p style=\"text-align: left;\">Je moet je cursusmateriaal online bestellen. Betalen kan via overschrijving of cash in de winkel. Eens je bestelling betaald is wordt hij geplaatst bij de drukker. Je krijgt een mail wanneer je bestelling klaarligt in de winkel.</p>\r\n<p style=\"text-align: left;\">Meer info over hoe bestellen&nbsp;<strong><a href=\"../../pages/guide\" target=\"_blank\">hier</a></strong></p>\r\n<p><strong>Waar :</strong></p>\r\n<p>We zijn te vinden in het BSG-lokaal (achter gebouw E).</p>\r\n<p><strong>Openingsuren :&nbsp;</strong></p>\r\n<p>Alle weekdagen van 12u tot 14u&nbsp;</p>\r\n<p>Elke dinsdag en donderdag avond van 17u30 tot 19u30</p>','2011-10-10 11:01:53','2011-10-10 11:03:23',0);
/*!40000 ALTER TABLE `messages` ENABLE KEYS */;
UNLOCK TABLES;

